class Meta extends React.Component {
  render(){
    return(
      <div>
        <h2>Meta</h2>
        <h3>What is <i>Quacker</i>?</h3>
        <p><i>Quacker</i> is a microblogging social media website for those whom want their voices heard.</p>
      </div>
    );
  }
}

export default Meta;
